import React from "react";
import Table from "../Table/Table";

const CPCalendar = () => {
  const fetchContest = async () => {
    let data;
    try {
      const res = await fetch(
        `https://clist.by/api/v2/contest/?username=himanshu_patel&api_key=4b4f6080d7056ddf5b5559c6967edb89a6fd5bce&upcoming=true&ongoing=true&format_time=true&order_by=resource_id&limit=500`
      );
      const result = await res.json();
      console.log(res);
      data = result.objects;
      console.log(data);
    } catch (error) {}
    const fruits = [];
    data?.map((index) => {
      fruits.push(index);
    });
    console.log(fruits);
  };
  useEffect(() => {
    fetchContest();
  }, []);

  return (
    <div>
      <Table />
    </div>
  );
};

export default CPCalendar;
